import { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbarbiss.css'; // Import your CSS file for styling

function Navbarbiss() {
  const [isOpen, setIsOpen] = useState(false);

  // Function to toggle the sidebar
  const toggleSidebar = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div>
      {/* Sidebar */}
      <div className={`sidebar ${isOpen ? 'open' : ''}`}>
        <span className="closebtn" onClick={toggleSidebar}>&times;</span>
        <Link to="/homebiss">Home</Link>
        <Link to="/boda">BodaBoda</Link>
        {/* Add other links as needed */}
      </div>

      {/* Main content */}
      <div className="content">
        <nav className='nav'>
          <span onClick={toggleSidebar}>open</span>
          {/* Other content */}
        </nav>
        {/* Rest of your content */}
      </div>
    </div>
  );
}

export default Navbarbiss;
